This was one of the wildest conditions that I've shot in for quite some time. Rainbows as vivid as a Lazer beams. No modifications to saturation needed for this. Due to the Sierra Nevada mountain range to the west, combined with 100mph winds, the rain would carry many miles downwind to the sunny Valley below... Creating the absolute perfect conditions for light refraction... But, where this gets weird was thanks to the conditions the rainbow lasted 4 hours uninterrupted. That is incredibly rare. For those that shoot landscape photography, you'll know how fleeting rainbows usually are, often only having enough time for a couple quick images. I'll share the drone aerial angles later, quite wild. Swipe right for the full thing.

